import './AddDive.css';
import {useState} from 'react';

function App() {
  const [count, setCount] = useState(1);
  const [date, setDate] = useState('');
  const [site, setSite] = useState('');
  const [equipment, setEquipment] = useState('');
  const [dive_duration, setDiveDuration] = useState(0);
  const [depth, setDepth] = useState(0);
  const [note, setNote] = useState('');

  return (    
    <form>  
    <div className='main-AddDive'>
      <div>
        Diving Number: {count} {()=>setCount(count + 1)}
      </div>
      <div>
        Date: <input required type="Date" className='block' value={date}/>
        Site: <input required type="text" className='block' value={site}/>
        Special equipment: <input type="text" value={equipment}/>
      </div>
      <div>
        Dive duration (minutes): <input required type="number" className='block' value={dive_duration}/>
        Depth (m) = <input required type="number" value={depth}/>
      </div>
      <div>
        Note:<br/>
        <textarea rows='4'></textarea>
      </div>
      <button className='neon-btn'>Add Dive</button>
    </div>
    </form>
    
  );
}

export default App;
